import React from 'react';
import styles from "./Main.module.scss";
import {Icon} from '@iconify/react';
import bikeIcon from '@iconify-icons/dashicons/bikeIcon';

const Main = () => {
    return ( 
        <div className={styles.main}>
            <Icon icon={bikeIcon} />
        </div>
     );
}

export default Main;
